import { Route, Routes, useInRouterMatch } from "react-router-dom";
import Test from "../components/Test";

const Welcome = () => {
	let match = useRouteMatch();

	return (
		<section>
			<h1>The Welcome Page!</h1>
			<Routes>
				<Route path={`${match.path}/:topicId`} element={<Test />}>
				</Route>
			</Routes>
		</section>
	)
};

export default Welcome;
